import React from 'react';
import Home from './Home';
import About from './About';
import{Route ,BrowserRouter as Router,Switch,Link} from "react-router-dom";

function App() {
  return (  
   <Router>
     <a>
       <Link to="/">Home</Link>
       </a>
       <div>
       <Link to="/">About</Link>
     </div>

     <Switch>
      <Route path="/" component={Home}/>
      <Route path="/" component={About}/>
      </Switch>

    </Router>  

  );
}
export default App;
